import React from "react";
import Ticker from "./Ticker";
import GridLayout from "react-grid-layout";

const TickersCopy = ({ tickers, onDelete }) => {
  console.log(tickers);

  const ticks = (tickers) => {
    tickers.map((ticker) => {
      <Ticker
        key={ticker.id}
        ticker={ticker}
        onDelete={() => onDelete(ticker.id)}
      >
        {ticker.tickername}
      </Ticker>
    })
  }


  return (
    <>
      {/* {tickers.map((ticker) => (
        <Ticker
          key={ticker.id}
          ticker={ticker}
          onDelete={() => onDelete(ticker.id)}
        >
          {ticker.tickername}
        </Ticker>
      ))} */}
      <GridLayout cols={12}>{ticks(tickers)}</GridLayout>;
    </>
  );
};

export default TickersCopy;
